import Header from '../components/Header';
import RedBackdrop from '../components/RedBackdrop';
import fs from 'fs';
import path from 'path';

const Features = ({ mp4FileNames }) => {
	return (
		<React.Fragment>
			<span>
				<Header />
				<RedBackdrop />
			</span>
			{mp4FileNames.map((file) => <div>file</div>)}
		</React.Fragment>
	);
};

export async function getStaticProps() {
	const mp4Path = path.join(path.cwd(), 'features', 'mp4');
	const mp4FileNames = fs.readdirSync(mp4Path);

	return {
		props: {
			mp4FileNames
		}
	};
}

export default Features;
